** - в сумме, не превышающей объемы авансирования, предусмотренные уведомлением Заказчика по Контракту на текущий финансовый год;
*** - данные указываются на дату составления кассового плана на очередной квартал;
**** - строка 5 заполняется головным исполнителем с учетом технологического цикла и этапности производства на основе реальной оценки производственных возможностей,
потребности в финансовых средствах кооперации на выполнение производственной программы, данных об остатке денежных средств на отдельном счете в уполномоченном
банке у  головного исполнителя.

